docs/usage/Models.html.body:
Creating Models
Modelizr is a tool that revolves around the models you create. Query generation, data mocking and normalization are all based on the structure of the models
that you build.
In this usage example we will be creating 4 models:

Person
Dog
Cat
Animal - Union of Dog and Cat

Models are defined by creating schemas. These schemas are then converted into Modelizr models and can be then used in queries. When creating these schemas we need to describe:

The model's normalization key. This is a string that all variations of the model will be normalized as.
The model's fields and field types. These are used when generating the GraphQL request and mocking a response.
Other model relationships that are associated with the model.

const Person = {
  normalizeAs: "People",
  fields: {
    id: {
      type: String,
      alias: "ID" // The generated query will contain the alias ID
    },
    firstName: String,
    age: Number,
    Friend: "Person", // Reference the 'Person' model as a relationship
    Pets: ["Animal"] // Wrapping a reference in an array indicates a collection
  },
  primaryKey: "id" // Which field to use as the primary key. Defaults to 'id'
}

const Dog = {
  normalizeAs: "Dogs",
  fields: {
    __type: String,
    id: String,
    breed: String,
    name: String,
    Owner: "Person"
  }
}

const Cat = {
  normalizeAs: "Cats",
  fields: {
    __type: String,
    id: String,
    name: String,
    Owner: "Person"
  }
}

Creating a union is done using a utility tool. To create a union you need to define an array of models of which it is a union of, and a schemaAttribute which is a key on each model
that describes the type of model it is.
import { union } from 'modelizr'

const Animal = union({
  models: ["Cat", "Dog"],
  schemaAttribute: "__type"
})

Now that we have defined out model data, we can pass it into modelizr and get back model functions which are used when making queries:
import { Modelizr } from 'modelizr'

const {models, query, mutate, fetch} = new Modelizr({
  models: {
    Person,
    Dog,
    Cat,
    Animal
  },
  config: {
    endpoint: "http:// ..."
  }
})

const {Person, Dog, Cat, Animal} = models

docs/usage/Querying.html.body:
Making Queries
Models can be used inside of query tools to generate a GraphQL query and send it off to the server.
Lets try use our models we have defined to query a Person, the persons Friend and his Pets.
...

const {Person, Dog, Cat, Animal} = models

query(
  Person({id: 1},
    Person("Friend"),

    Animal("Pets"
      Dog, Cat
    )
  )
).then((res, normalize) => {
    ...
})

Internally this will generate a GraphQL query and post it to the configured endpoint. The query generated will look as follows:
query modelizr_query {
  Person(id: 1) {
    id,
    firstName,
    age,
    Friend {
      id,
      firstName,
      age
    },
    Pets: {
      ... on Cat {
        __type,
        id,
        name
      },

      ... on Dog {
        __type,
        id,
        breed,
        name
      }
    }
  }
}

The actual GraphQL response received might look something like this:
const res = {
  data: {
    Person: {
      id: 1,
      firstName: "John",
      age: 20,
      Friend: {
        id: 2,
        firstName: "Jimmy",
        age: 21
      },
      Pets: [
        {
          __type: "Cat",
          id: 1,
          name: "James"
        },
        {
          __type: "Dog",
          id: 3,
          breed: "Labrador",
          name: "Bran"
        },
        ...
      ]
    }
  }
}

This is expected, but not something we want to work with. Within our application's state we want to store data in a flat map. Modelizr can do this by 
looking at the model relationships already defined previously. Internally it uses normalizr to achieve this. 
Here is how we can normalize our response:
...

query(
  Person({id: 1},
    Animal("Pets"
      Dog, Cat
    )
  )
).then((res, normalize) => {
  const {entities, result} = normalize(res.data)

  /* And now we can use it in our application */
  store.dispatch({
    type: "SET_ENTITIES",
    payload: entities
  })
})

The resulting flattened entities will now look like this:
const entities = {
  People: {
    1: {
      id: 1,
      firstName: "John",
      age: 20,
      Friend: 2,
      Pets: [
        { 
          id: 1,
          schema: "Cat"
        },
        {
          id: 3,
          schema: "Dog",
        },
        ...
      ]
     },
     2: {
       id: 2,
       firstName: "Jimmy",
       age: 21
     }
    },

    Cats: {
        1: {
          id: 1,
          name: "James"
        }
    },

    Dogs: {
     3: {
          id: 3,
          name: "Brad",
          breed: "Labrador"
     } 
    }
}

Making a mutation is just as simple. Lets try changing a Persons name and age!
mutate(
  Person({id: 1, firstName: "James", age: 21})
)

This will generate a GraphQL mutation and post it at the configured endpoint:
mutation modelizr_query {
  Person(id: 1, firstName: "James", age: 21) {
    id,
    firstName,
    age
  }
}

Now on to mocking!

docs/usage/Mocking.html.body:
Mocking
The goal with mocking is to produce data that is structured in the exact same way as an actual GraphQL response.
Lets mock the query for a Person we made in the previous step:
query(
  Person({id: 1},
    Animal("Pets"
      Dog, Cat
    )
  )
).mock() // => Appending the 'mock' results in a mocked response
.then((res, normalize) => {
  ...
})

Our mocked response will now look something like this:
const res = {
  data: {
    Person: {
      id: "05438a43-00e5-4e2d-9720-ecb1bc9093b9",
      firstName: "0bf14db1",
      age: 50123,
      Friend: {
        id: "8a008933-b5c3-4809-aef7-5a3c34c1c3b6",
        firstName: "c6187c73",
        age: 45674
      },
      Pets: [
        {
          __type: "Cat",
          id: "efaaa503-d453-4191-a177-307774d2ab10",
          name: "f0b2b542"
        },
        {
          __type: "Dog",
          id: "6a146a9c-779b-486a-bc13-25b72c6d555e,
          breed: "6a146a9c",
          name: "b245d540"
        },
        ...
      ]
    }
  }
}

All the generated data is in the correct format in this example, but it isn't very human readable - for example, the persons name is 0bf14db1. We can 
improve the quality of the mocked data by adding more information to our models.
const Person = {
  normalizeAs: "People",
  fields: {
    id: {
      type: String,
      alias: "ID" // The generated query will contain the alias ID
    },
    firstName: {
      type: String,
      faker: "name.firstName"
    },
    age: {
      type: Number,
      min: 1,
      max: 100
    },
    Friend: "Person", // Reference the 'Person' model as a relationship
    Pets: ["Animal"] // Wrapping a reference in an array indicates a collection
  },
  primaryKey: "id" // Which field to use as the primary key. Defaults to 'id'
}

Now when queries are mocked, the data generated will be much more accurate. here is an example of a mocked Person after updating the model:
const res = {
  data: {
    Person: {
      id: "05438a43-00e5-4e2d-9720-ecb1bc9093b9",
      firstName: "James",
      age: 32,
      ...
    }
  }
}

docs/patterns/Fragments.html.body:
Fragments
A useful pattern when making multiple queries that use the same sequence of models is to pre-define a query fragment. Something like this:
const {models, query} = new Modelizr({ ... })

const {Person, Animal, Cat, Dog} = models

const PersonFragment = Person(
  Animal("Pets",
    Dog, Cat
  )
)

query(
  PersonFragment
).then(res => { ... })

A fragment can even be executed again without losing it's previous children
...

query(
  PersonFragment("People",
    Person("Friend")
  )
)

/* Resulting query will look as follows */
{
  People {
    id,
    name,
    ...,
    Friend {
      id,
      name,
      ...
    },
    Pets {
      ... on Dog {
        __type,
        id,
        breed,
        ...
      },

      ... on Cat {
        __type,
        id,
        name,
        ...
      }
    }
  }
}

docs/api/ModelSchemas.html.body:
Model Schemas
A schema is a piece of data that describes the fields and relationships of models.
Model Schema Properties
name string
The name of the model. This key is used for defining relationships with other models. Defaults to the model key when given to modelizr
normalizeAs string
The key under which all variations of this model will be normalized. Defaults to the model's name
fields object
A collection of name => field that describes the fields and relationships of the model
primaryKey string
The field which represents the primary key of the model. Defaults to id
Field
A field can be either a javascript Type, a string or an object. A string type field represents a relationship with another model. If the type of the field
is wrapped in an array, it will be assumed to be a collection and will be normalized as such (for relationships) and mocked as an array.
An object type field can have the following properties:
type Type required
This is the type of the field, and can be one of the 4 javascript Types: String, Number, Boolean, Object
properties object
A collection of name => field. This property is used in conjunction with type: Object
alias string
Used to declare a GraphQL aliased field. This changes the generated GraphQL query
faker string
A string referencing a faker category to use when mocking the field. Refer to Faker Categories for a 
list of available values.
pattern string
A pipe separated collection of values to use when mocking the field. Example: Yes|No|Maybe
min number
Specify the minimum number to generate when mocking. Used in conjunction with type: Number
max number
Specify the maximum number to generate when mocking. Used in conjunction with type: Number
decimal boolean
Specify whether the generated number should be a decimal or not when mocking. Used in conjunction with type: Number. Defaults to false
quantity number
An amount of entities to generate when mocking the field. Used in conjunction with a collection type, eg: type: [String]
Union Schema Properties
A union is a collection of models and is defined slightly differently. A schema is considered a union of it has the following properties:
models array required
A collection of model names that the union is a group of.
schemaAttribute string | function required
A field from each of its model children that can be used to identify the model. The name of the model is used in schema relationships. If a function is 
given, the function will be used to infer the schema.
Example
const Cat = {
  name: "Cat",
  normalizeAs: "Cats",
  fields: {
    ID: String,
    name: {
      type: String,
      faker: "name.firstName"
    },
    age: {
      type: Number,
      min: 1,
      max: 10
    },
    Owner: "Person"
  },
  primaryKey: "ID"
}

const Dog = {
  name: "Dog",
  normalizeAs: "Dogs",
  fields: {
    id: String,
    name: {
      type: String,
      faker: "name.firstName"
    },
    breed: {
      type: String,
      pattern: "Lab|GS|Colly"
    },
    Owner: "Person"
  }
}

const Animal = {
  name: "Animal",
  models: ["Cat", "Dog"],
  schemaAttribute: "__type"
}

const Person = {
  name: "Person",
  normalizeAs: "People",
  fields: {
    id: String,
    name: {
      type: String,
      faker: "name.firstName"
    },
    currentLocation: {
      type: Object,
      properties: {
        latitude: {
          type: Number,
          decimal: true
        },
        longitude: {
          type: Number,
          decimal: true
        }
      }
    },
    Pets: ["Animal"]
  }
}

import { Modelizr } from 'modelizr'

const {models} = new Modelizr({
    models: {
        Person, Dog, Cat, Animal
    }
})

// {Person, Dog, Cat, Animal} = models

docs/api/Modelizr.html.body:
Modelizr(options: object) => Client
The constructor for this library. Accepts model schemas and some configuration options. Returns the query tools and model functions
options
models object
A collection of schemas that will be interpreted by Modelizr
import { Modelizr } from 'modelizr'

const Person = {
  normalizeAs: "People",
  fields: { ... }
}

const client = new Modelizr({
  models: {
    Person: Person
  },
  config: {
    ...
  }
})

config object
Global configuration properties
endpoint string required
The endpoint to send requests to
mock boolean
Whether or not to mock all requests. Defaults to false
debug boolean
Whether or not to enable debugging. Defaults to false
throwsOnErrors boolean
Whether or not to throw an error when a GraphQL response contains errors. Defaults to true
Throws a GraphQLError:
import { GraphQLError } from 'modelizr'

...

query(
  Person
)
  .then(res => { ... })
  .catch(e => {
    if (e instanceof GraphQLError) {
      // contains graphQL errors
    }
  })

api Function
Replace the fetch api used internally with a custom one. Have a look at the Modelizr Fetch Api to see what Modelizr expects.
Client
The client that is constructed contains query tools and model functions generated from the provided model schemas
import { Modelizr } from 'modelizr'

const {models, query, mutate, fetch} = new Modelizr({})

docs/api/Models.html.body:
Models
Modelizr model functions are generated from schemas. These model functions are what is used when constructing GraphQL queries and mutations. They have various
properties to make it more convenient to work with them.
Model functions are a type of Builder Function that means they always return another model function when called or chained. Although they are functions, they do
not need to be executed in order to be used in queries, but more on that later.
Execution ([fieldName: string, params: object, ...children: Model])
All models can be executed with three optional parameters. When executed, the model function returns a new model function.
fieldName string
If specified, this changes the fieldName in the generated query. As an example, A model with name: Person would generate the following query:
{
  Person {
    id,
    name,
    ...
  }
}

Specifying the fieldName as friend - Person("Friend") - would generate the following:
{
  Friend {
    id,
    name,
    ...
  }
}

params object
If specified, this adds parameters to the generated query. As an example, Person({id: 1}) would generate the following query:
{
  Person(id: 1) {
    id,
    name,
    ...
  }
}

children ...Model
All additional arguments may be Model children and will result in the children model's fields being added as sub-fields. As an example, Person(Dog) will
generate the following query:
{
  Person {
    id,
    name,
    ...,
    Dog {
      id,
      ...
    }
  }
}

Modifiers
In addition to execution parameters, there are a few modifiers which can be applied to models. Modifiers also return a new Model Function when called.
.only(fields: Array)
Limits the generated fields to only contain fields
query(
  Person.only(["name"])
)

...

{
  Person {
    name
  }
}

.without(fields: Array)
Limits the generated fields to not contain certain fields
query(
  Person.without(["name"])
)

...

{
  Person {
    id,
    ...
  }
}

.empty()
Remove all fields from the generated query. Commonly used when making empty mutations
mutate(
  Person({id: 1, name: "James"}).empty()
)

...

mutation modelizr_mutation {
  Person(id: 1, name: "James")
}

docs/api/FetchAPI.html.body:
Fetch API
The internal Fetch API used by Modelizr. The API is a function that accepts all modifications made to the query tool calling it, and returns a promise 
containing the server result.
Basic structure of the API
type ConfigType = {
  endpoint: string,
  api: Function,
  headers: ?{[key: string]: string},
  method: ?string,
  mock: ?boolean | Object,
  debug: ?boolean,
  body: ?Object,
  throwOnErrors: boolean
}

export const FETCH_API = (config: ConfigType) => {
  const method: string = (config.method || "POST").toUpperCase()
  let server_response

  return fetch(config.endpoint, {
    headers: {
      'Accept': 'application/json',
      'Content-Type': 'application/json',
      ...config.headers
    },
    method,
    ...(method != "GET" && method != "HEAD" ? {
      body: JSON.stringify(config.body)
    } : {})
  })
    .then(res => {
      server_response = res
      return res.json()
    })
      .then(res => {
        if (res.errors && config.throwOnErrors) {
          if (config.throwOnErrors) throw new GraphQLError("The GraphQL server responded with errors.", res.errors)
      }

        return {
          server_response,
          ...res
        }
    })
}

If you are wanting to provide your own custom fetch api, then it must return a promise in order to work with modelizr.
